import React from 'react'
import Slider from 'react-slick'
import PropertyData from '../../Assets/Data/PropertyData'
import { Box ,Card,CardMedia,Typography } from '@mui/material'


const RecentlyAdd = () => {

    var settings = {
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll:3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };

  return (
    <div>RecentlyAdd
     <Slider {...settings}>
     {PropertyData.map((item)=> (
            <Card>
                     <CardMedia component='img'
                      image={item.image}
                      alt='/'
                      height='200px'
              
                       />

                       
                    <Box mx={1} mt={0} mb={0}>
                    <Typography variant='h6' fontWeight={600}>
                    {item.title}
                     </Typography>  
                    <Typography>
                    Price: <span style={{color:'red'}}> {item.price}</span>
                     </Typography>
                     <Typography>
                    {item.type}
                     </Typography> 
                    </Box>
            </Card>
           ))}
          
        </Slider>
    </div>
  )
}

export default RecentlyAdd
